import React, { Component } from 'react';
import { Avatar } from '@mui/material';
import './Statusbar.css';
import people1 from '../../images/pp1.png'
class Statusbar extends Component {
    constructor(props) {
        super(props);
        this.state=
        {
            statusList:[]
        }
    }

    componentDidMount

    getData=()=>
    {
        let data=[
            {
                "imageurl":"people1",
                "username":"raj_rajat_narula"
            },
            {
                "imageurl":"people1",
                "username":"raj_rajat_narula"
            },
            {
                "imageurl":"people1",
                "username":"raj_rajat_narula"
            },
            {
                "imageurl":"people1",
                "username":"raj_rajat_narula"
            },
            {
                "imageurl":"people1",
                "username":"raj_rajat_narula"
            },
            {
                "imageurl":"people1",
                "username":"raj_rajat_narula"
            },
            {
                "imageurl":"people1",
                "username":"raj_rajat_narula"
            }
        ]
        this.setState({statusList:data});
    }
    
    render() { 
        return ( 
            <div>
                <div className='statusbar_container'>

                    {
                        this.state.statusList.map((item,index)=>
                        {
                            <div className='status'>
                                <Avatar className='statusbar_status' src={people1}  />
                                <div className='statusbar_text'>raj_rajat_narula</div>
                            </div>

                        })
                    }
                    

                </div>
            </div>
         );
    }
}
 
export default Statusbar;
